import React from "react";
import s from './Navbar.module.css'

function Nav() {
    return(
        <nav className={s.nav}>
            <div className={s.item}>
                <div> <a>Profile</a> </div>
                <div> <a>Messages</a> </div>
                <div> <a>News</a> </div>
                <div> <a>Music</a> </div>
                <div> <a>Settings</a> </div>
            </div>
        </nav>
    );
}
export default Nav;
